The skeleton of a Calyx program has three sections, and looks like this: component main() -> { cells { } wires { } control { }
} cells contains declarations for logical hardware units like adders, memories and registers. wires contains groups that connect together the units declared in cells and form the structure of the hardware. control contains the logic specifying when the groups will perform their computation. Walking the nodes of the AST we defined earlier, we'll generate strings that we'll insert into each of these sections. The next few sections will discuss the different node types. Decl nodes Decl nodes instantiate new memories and registers. We need these to be instantiated in the cells section of our Calyx output. Here's Calyx code that creates a new memory foo, with 4 32-bit elements and a 32-bit indexor: foo = std_mem_d1(32, 4, 32); For each Decl node, we need to determine if we're instantiating a memory or a register, and then translate that to a corresponding Calyx declaration and place that inside the cells section of our generated program. Here's some code from our compiler that walks through each register and memory declaration, and generates a Calyx program with those registers: def emit(prog): """ Returns a string containing a Calyx program, compiled from prog, a MrXL program. """ cells, wires, control = [], [], [] (emit_mem_decl emits a string of the form "mem_name = std_mem_d1(<element_width>, <num_elements>, <index_width>)".) Map and Reduce nodes For every map or reduce node, we need to generate Calyx code that iterates over an array, performs some kind of computation, and then stores the result of that computation. For map operations, we'll perform a computation on an element of an input array, and then store the result in a result array. For reduce operations, we'll also use an element of an input array, but we'll also use an accumulator register that we'll use in each computation, and we'll also store to. For example, if we were writing a reduce that summed up the elements of an input array, we'd use an accumulator register that was initialized to hold the value 0, and add to the value of this register each element of an input array. We can implement these behaviors using Calyx groups: incr_idx: Increments an idx register using an adder. This group is done when the idx register is written to. cond: Applies a "less than" operator to idx, and the length of our input arrays, using the le hardware unit. eval_body: Reads from an array, performs some kind of computation, and writes the result of the computation to an accumulator register or another array. We'll make these groups for each Map and Reduce node, so to avoid naming collisions, we'll suffix each group with an integer starting at 0, incrementing each time we need to add a new set of groups. These groups will be added to the wires section. We'll also need to add logic to the control section as well that uses these groups to process arrays: while le0.out with cond0 { seq { eval_body0; incr_idx0; }
} This logic orchestrates our groups, basically representing iterating over our array and evaluating some computation on each element of the array. On each iteration we signal for the eval_body0 group to do its work, followed sequentially by incr_idx0 to advance our index register so that we can work on the next element of the array.

