MrXL allows you to parallelize your map and reduce operations. Let's revisit the map example from earlier: input foo: int[4]
output baz: int[4]
baz := map 4 (a <- foo) { a + 5 } The number 4 after the map specifies the number of adders we can use at once to parallelize this computation. There are a few ways we could parallelize this program, and one of them is to split the memories used in the map operation into 4 separate memory banks , and then we can read from each bank of foo and write into each bank of baz simultaneously. In general, we can break memories of size m into b banks (each with size m/b), and then simultaneously process those b banks. Realizing this in Calyx means creating separate memories for each bank, and creating groups to process each bank. Here's a section of the compiler that generates banked memories: Group, CompVar, Stdlib, Cell, Program, Component, Import, SeqComp, ConstantPort, HolePort, CompPort, Enable, While, ParComp, CombGroup, In the Map and Reduce code generation section we described groups that could be orchestrated to iterate over a memory and process it. We'll now have to do that for each memory bank, and then parallelize these operations in the generated Calyx's control section. We can accomplish this with Calyx's par keyword, signalling to execute groups in parallel. Here's an example of executing four while loops in parallel: par { while le_b0.out with cond_b0 { seq { eval_body_b0; incr_idx_b0; } } while le_b1.out with cond_b1 { seq { eval_body_b1; incr_idx_b1; } } while le_b2.out with cond_b2 { seq { eval_body_b2; incr_idx_b2; } } while le_b3.out with cond_b3 { seq { eval_body_b3; incr_idx_b3; } }
}

