Calyx has an attribute system that allows information to be associated with every basic Calyx construct. This information can then be used to optimize the program or change how the program is compiled. Attributes can decorate lots of things in Calyx: components, groups, cells, ports, and control statements. The syntax looks like name<"attr"=value> for components and groups or @attr(value) for other constructs. Attributes always map keys to values. Because it's common to have a "Boolean" attribute that always maps to the value 1, the syntax @attr is a shorthand for @attr(1). Here is the syntax for attributes in different parts of the AST: Component and Port Attributes component main<"static"=10>(@go go: 1) -> (@done done: 1) { ...
} Cell Attributes cells { @external mem = std_mem_d1(32, 8, 4); reg = std_reg(32); ...
} Group Attributes group cond<"static"=1> { ...
} Control Attributes control { @static(3) seq { @static(1) A; @static(2) B; }
}

